          </select> 
          <input type="search" v-model="nameSearch" placeholder="Название"  v-on:change="handleSubmit();" class="classic1" /> 
          <input type="search" v-model="otraslSearch" placeholder="Отрасль"  v-on:change="handleSubmit();" class="classic1" />
          
